import React,{useState} from 'react'
import { useNavigate,Link } from 'react-router-dom'
import "../styles/Register.css";
import Alert from './Alert';

const Register = () => {
  let navigate = useNavigate();
  const [credentials, setCredentials] = useState({"email":"","password":"","cpassword":"","countrycode":"+91","mobilenumber":"","firstname":"", "lastname":"","dateofbirth":"","gender":"","state":"Select State"})
  const [placeholder, setPlaceholder] = useState({"fname":"dnone","lname":"dnone","email":"dnone", "pwd":"dnone","cpwd":"dnone","countrycode":"dblock","mobilenumber":"dnone","dob":"dblock"})
  const [height,setHeight] = useState({"fname":"ihide", "lname":"ihide","email":"ihide", "pwd":"ihide","cpwd":"ihide","countrycode":"ishow","mobilenumber":"ihide","dob":"ishow"})
  const [alert,setAlert] = useState({})
  const [alertborder, setAlertborder] = useState({"email":"","password":"","cpassword":"","countrycode":"","mobilenumber":"","firstname":"", "lastname":"","dateofbirth":"","gender":"","state":""})
  const onChangelogin = (e) => {
      setCredentials({...credentials,[e.target.name]:e.target.value})
  } 

  const handleSubmit = async (e) => {
    e.preventDefault();
        const response = await fetch ("http://localhost:4000/api/v1/auth",{
            method:'POST',
            headers: {
              'Content-Type': 'application/json'
            },
            body: JSON.stringify({email: credentials.email, 
                                  password: credentials.password,
                                  countrycode: credentials.countrycode,
                                  mobilenumber: credentials.mobilenumber,
                                  firstname: credentials.firstname,
                                  lastname: credentials.lastname,
                                  dateofbirth: credentials.dateofbirth,
                                  gender:credentials.gender,
                                  state: credentials.state
                              })
          })
          const json = await response.json()
          if (json.success){
            localStorage.setItem('token', json.authtoken); 
            navigate('/');
          }
          else{
            alert('try again')
          }
  }
  const selectState = (e) => {
        setCredentials({...credentials,"state":e.target.getAttribute('data-value')})
  }
  return (
    <div className='register-con'>
        <div className='lr-f-title'>Register</div>
    <form className='lr-form' onSubmit={handleSubmit}>
        <div className='cred-con part-con'>
            <div>Let's create your credentials</div>
            <div>
                <div>
                    <div className={`lr-input-item lr-email-input-item ${alertborder.email}`}>
                        <div className={`lr-placeholder ${placeholder.email}`}>Email</div>
                        <input className={`email-input lr-input ${height.email}`} onFocus={(e)=> {
                                if(!e.target.value){
                                    e.target.placeholder="" 
                                    setPlaceholder({...placeholder,"email":"dblock"})
                                    setHeight({...height,"email":"ishow"})
                                }
                            }
                        } 
                        onBlur={(e)=> {
                                let regex = /@/.test(credentials.email)
                                setAlert({...alert,"email":regex})
                                regex?setAlertborder({...alertborder,"email":''}):setAlertborder({...alertborder,"email":'alert-border'})
                                if(e.target.value === ''){
                                    e.target.placeholder="Enter your email address"
                                    setPlaceholder({...placeholder,"email":"dnone"})
                                    setHeight({...height,"email":"ihide"})
                                }
                            }
                        } 
                        placeholder='Enter your email address' onChange={onChangelogin}  value={credentials.email} type="email"  name="email" id="username" required/>
                    </div>
                    {alert.email === false?<Alert error={"Enter a valid email address"}/>:<></>}
                </div>
                <div className='d-flex'>
                    <div className={`lr-input-item  ${alertborder.password}`}>
                        <div className={`lr-placeholder ${placeholder.pwd}`}>Password</div>
                        <input className={`pwd-input mutli-input lr-input ${height.pwd}`} onFocus={(e)=> {
                                if(!e.target.value){
                                    e.target.placeholder="" 
                                    setPlaceholder({...placeholder,"pwd":"dblock"})
                                    setHeight({...height,"pwd":"ishow"})
                                }
                            }
                        } 
                        onBlur={(e)=> {
                                let regex = /^[a-zA-Z0-9!@#\$%\^\&*\)\(+=._-]{8,}$/.test(credentials.password)
                                setAlert({...alert,"password":regex})
                                regex?setAlertborder({...alertborder,"password":''}):setAlertborder({...alertborder,"password":'alert-border'})
                                if(e.target.value === ''){
                                    e.target.placeholder="Enter your password"
                                    setPlaceholder({...placeholder,"pwd":"dnone"})
                                    setHeight({...height,"pwd":"ihide"})
                                }
                            }
                        }   
                        placeholder='Enter your password'  onChange={onChangelogin}  value={credentials.password} type="text"  name="password"id="password" required/>
                    </div>
                    <div className={`lr-input-item  ${alertborder.cpassword}`}>
                        <div className={`lr-placeholder ${placeholder.cpwd}`}>Confirm your password</div>
                        <input className={`cpwd-input mutli-input lr-input ${height.cpwd}`} onFocus={(e)=> {
                                if(!e.target.value){
                                    e.target.placeholder="" 
                                    setPlaceholder({...placeholder,"cpwd":"dblock"})
                                    setHeight({...height,"cpwd":"ishow"})
                                }
                            }
                        } 
                        onBlur={(e)=> {
                                credentials.password === credentials.cpassword?setAlert({...alert,"cpassword":true}):setAlert({...alert,"cpassword":false})
                                credentials.password === credentials.cpassword?setAlertborder({...alertborder,"cpassword":''}):setAlertborder({...alertborder,"cpassword":'alert-border'})
                                if(e.target.value === ''){
                                    e.target.placeholder="Confirm your password"
                                    setPlaceholder({...placeholder,"cpwd":"dnone"})
                                    setHeight({...height,"cpwd":"ihide"})
                                }
                            }
                        }   
                        placeholder='Confirm your password'  onChange={onChangelogin}  value={credentials.cpassword} type="text"  name="cpassword"id="cpassword"/>
                    </div>
                </div>
                {alert.password === false?<Alert error={"Your password should be minimum 8 characters long"}/>:<></>}
                {alert.cpassword === false?<Alert error={"Password does not match"}/>:<></>}
                <div className='d-flex'>
                    <div className='lr-input-item'>
                        <div className={`lr-placeholder ${placeholder.countrycode}`}>Country code</div>
                        <div className={`mutli-input lr-input ${height.countrycode}`}>
                           {credentials.countrycode}
                        </div>
                    </div>
                    <div className={`lr-input-item  ${alertborder.mobilenumber}`}>
                        <div className={`lr-placeholder ${placeholder.mobilenumber}`}>Mobile Number</div>
                        <input className={`mobile-input mutli-input lr-input ${height.mobilenumber}`} onFocus={(e)=> {
                                if(!e.target.value){
                                    e.target.placeholder="" 
                                    setPlaceholder({...placeholder,"mobilenumber":"dblock"})
                                    setHeight({...height,"mobilenumber":"ishow"})
                                }
                            }
                        } 
                        onBlur={(e)=> {
                            let regex = /^[0-9!]{10,}$/.test(credentials.mobilenumber)
                                setAlert({...alert,"mobilenumber":regex})
                                regex?setAlertborder({...alertborder,"mobilenumber":''}):setAlertborder({...alertborder,"mobilenumber":'alert-border'})
                                if(e.target.value === ''){
                                    e.target.placeholder="Mobile Number"
                                    setPlaceholder({...placeholder,"mobilenumber":"dnone"})
                                    setHeight({...height,"mobilenumber":"ihide"})
                                }
                            }
                        } 
                        placeholder='Mobile Number' onChange={onChangelogin}  value={credentials.mobilenumber} type="tel" maxLength={10}  name="mobilenumber" id="mobilenumber"/>
                    </div>
                </div>
                {alert.mobilenumber === false?<Alert error={"Your mobile number should be 10 characters long"}/>:<></>}
            </div>
        </div>
        <div className='pd-con part-con'>
            <div>Your personal details</div>
            <div>
                <div className='d-flex'>
                        <div className={`lr-input-item ${alertborder.firstname}`}>
                            <div className={`lr-placeholder ${placeholder.fname}`}>First name</div>
                            <input className={`fname-input mutli-input lr-input ${height.fname}`} onFocus={(e)=> {
                                    if(!e.target.value){
                                        e.target.placeholder="" 
                                        setPlaceholder({...placeholder,"fname":"dblock"})
                                        setHeight({...height,"fname":"ishow"})
                                    }
                                }
                            } 
                            onBlur={(e)=> {
                                let regex = /@/.test(credentials.firstname)
                                    setAlert({...alert,"firstname":regex})
                                    regex?setAlertborder({...alertborder,"firstname":''}):setAlertborder({...alertborder,"firstname":'alert-border'})
                                    if(e.target.value === ''){
                                        e.target.placeholder="First name"
                                        setPlaceholder({...placeholder,"fname":"dnone"})
                                        setHeight({...height,"fname":"ihide"})
                                    }
                                }
                            } 
                            placeholder='First name' onChange={onChangelogin}  value={credentials.firstname} type="text"  name="firstname" id="firstname"/>
                        </div>
                        <div className={`lr-input-item ${alertborder.lastname}`}>
                            <div className={`lr-placeholder ${placeholder.lname}`}>Last name</div>
                            <input className={`lname-input mutli-input lr-input ${height.lname}`} onFocus={(e)=> {
                                    if(!e.target.value){
                                        e.target.placeholder="" 
                                        setPlaceholder({...placeholder,"lname":"dblock"})
                                        setHeight({...height,"lname":"ishow"})
                                    }
                                }
                            } 
                            onBlur={(e)=> {
                                    let regex = /@/.test(credentials.lastname)
                                    setAlert({...alert,"lastname":regex})
                                    regex?setAlertborder({...alertborder,"lastname":''}):setAlertborder({...alertborder,"lastname":'alert-border'})
                                    if(e.target.value === ''){
                                        e.target.placeholder="Last name"
                                        setPlaceholder({...placeholder,"lname":"dnone"})
                                        setHeight({...height,"lname":"ihide"})
                                    }
                                }
                            } 
                            placeholder='Last name' onChange={onChangelogin}  value={credentials.lastname} type="text"  name="lastname" id="lastname"/>
                        </div>
                </div>
                {alert.firstname === false?<Alert error={"Please enter your first name"}/>:<></>}
                {alert.lastname === false?<Alert error={"Please enter your last name"}/>:<></>}
                <div className='d-flex'>
                    <div className={`lr-input-item ${alertborder.dateofbirth}`}>
                        <div className={`lr-placeholder ${placeholder.dob}`}>Date of birth</div>
                        <input className={`dob-input mutli-input lr-input ${height.dob}`} 
                        onBlur={(e)=> {
                            credentials.dateofbirth?setAlert({...alert,"dateofbirth":true}):setAlert({...alert,"dateofbirth":false})
                            credentials.dateofbirth?setAlertborder({...alertborder,"dateofbirth":''}):setAlertborder({...alertborder,"dateofbirth":'alert-border'})
                            }
                        }    
                        placeholder='Date of birth' onChange={onChangelogin}  value={credentials.dateofbirth} type="date"  name="dateofbirth" id="dateofbirth"/>
                    </div>
                    <div>
                        <div>Gender (Optional)</div>
                        <div className='select-radio-con'>
                            <div className="form-check select-radio">
                                <input className="form-check-input select-input" type="radio" name="genderOptions" id="genderOptions1"/>
                                <label className="form-check-label select-label" htmlFor="genderOptions1">
                                    Male
                                </label>
                            </div>
                            <div className="form-check select-radio">
                                <input className="form-check-input select-input" type="radio" name="genderOptions" id="genderOptions2"/>
                                <label className="form-check-label select-label" htmlFor="genderOptions2">
                                    Female
                                </label>
                            </div>
                        </div>
                    </div>
                </div>
                {alert.dateofbirth === false?<Alert error={"Please enter your date of birth"}/>:<></>}
            </div>
        </div>
        <div className='wliv-con part-con'>
            <div>Where do you live ?</div>
            <div>
                <div className="dropdown">
                    <div className={`dropdown-toggle lr-dropdown lr-input-item live-dd ${alertborder.state}`}  role="button" data-bs-toggle="dropdown" aria-expanded="false">
                        {credentials.state}
                    </div>
                    <div className="dropdown-menu dd-menu">
                        <div  onClick={selectState}  data-value="Andhra Pradesh" className="dropdown-item">Andhra Pradesh</div>
                        <div  onClick={selectState}  data-value="Arunachal Pradesh" className="dropdown-item">Arunachal Pradesh</div>
                        <div  onClick={selectState}  data-value="Assam" className="dropdown-item">Assam</div>
                        <div  onClick={selectState}  data-value="Bihar" className="dropdown-item">Bihar</div>
                        <div  onClick={selectState}  data-value="Chhattisgarh" className="dropdown-item">Chhattisgarh</div>
                        <div  onClick={selectState}  data-value="Goa" className="dropdown-item">Goa</div>
                        <div  onClick={selectState}  data-value="Gujarat" className="dropdown-item">Gujarat</div>
                        <div  onClick={selectState}  data-value="Haryana" className="dropdown-item">Haryana</div>
                        <div  onClick={selectState}  data-value="Himachal Pradesh" className="dropdown-item">Himachal Pradesh</div>
                        <div  onClick={selectState}  data-value="Jharkhand" className="dropdown-item">Jharkhand</div>
                        <div  onClick={selectState}  data-value="Karnataka" className="dropdown-item">Karnataka</div>
                        <div  onClick={selectState}  data-value="Kerala" className="dropdown-item">Kerala</div>
                        <div  onClick={selectState}  data-value="Madhya Pradesh" className="dropdown-item">Madhya Pradesh</div>
                        <div  onClick={selectState}  data-value="Maharashtra" className="dropdown-item">Maharashtra</div>
                        <div  onClick={selectState}  data-value="Manipur" className="dropdown-item">Manipur</div>
                        <div  onClick={selectState}  data-value="Meghalaya" className="dropdown-item">Meghalaya</div>
                        <div  onClick={selectState}  data-value="Mizoram" className="dropdown-item">Mizoram</div>
                        <div  onClick={selectState}  data-value="Nagaland" className="dropdown-item">Nagaland</div>
                        <div  onClick={selectState}  data-value="Odisha" className="dropdown-item">Odisha</div>
                        <div  onClick={selectState}  data-value="Punjab" className="dropdown-item">Punjab</div>
                        <div  onClick={selectState}  data-value="Rajasthan" className="dropdown-item">Rajasthan</div>
                        <div  onClick={selectState}  data-value="Sikkim" className="dropdown-item">Sikkim</div>
                        <div  onClick={selectState}  data-value="Tamil Nadu" className="dropdown-item">Tamil Nadu</div>
                        <div  onClick={selectState}  data-value="Telangana" className="dropdown-item">Telangana</div>
                        <div  onClick={selectState}  data-value="Tripura" className="dropdown-item">Tripura</div>
                        <div  onClick={selectState}  data-value="Uttarakhand" className="dropdown-item">Uttarakhand</div>
                        <div  onClick={selectState}  data-value="Uttar Pradesh" className="dropdown-item">Uttar Pradesh</div>
                        <div  onClick={selectState}  data-value="West Bengal" className="dropdown-item">West Bengal</div>
                    </div>
                </div>
                {credentials.state === 'Select State'?<Alert error={"Please select your state you live in"}/>:<></>}
            </div>
        </div>
        <div className='btn-con'>
            <button className='lr-btn' disabled>Create an account</button>
        </div>
    </form>
</div>
  )
}

export default Register
